import TrackCard from '../../pages/trackCard'; 

function SongsComponent({ trackData }) {
  
  return (
    <div className='outlined-stats-container'>
      <div className='glassmorphism-test'>

      </div>

      <div className='dashboard-flexbox-container song-component-container'>
        <div className='topArtists-container'>
          <h1>Top Tracks</h1>
            <div className='topArtists'>
              {trackData.slice(0, 50).map((artist, index) => (
                <TrackCard
                  key={index}
                  imageSrc={artist.image[0].url} 
                  artistName={artist.name}
                  position={artist.position}
                  id={artist.id}
                />
              ))}
             </div>
            </div>
          </div>
    
        </div>
  );
}

export default SongsComponent;
